import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import styles from './dashboard.module.scss';
import className from 'classnames/bind';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faClock } from '@fortawesome/free-regular-svg-icons';
import { faChartSimple, faHouse, faPeopleGroup, faUserAlt } from '@fortawesome/free-solid-svg-icons';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const cx = className.bind(styles);

function MyChart() {
    let navigate = useNavigate();
    function DashBoard() {
        navigate('/dashboard');
    }
    function User() {
        navigate('/user');
    }
    function Logout() {
        alert('Logout ?');
        navigate('/');
    }

    const data = [
        { name: 'Jan', Sales: 4000, Gross: 2400 },
        { name: 'Feb', Sales: 3000, Gross: 1398 },
        { name: 'Mar', Sales: 2000, Gross: 9800 },
        { name: 'Apr', Sales: 2780, Gross: 3908 },
        { name: 'May', Sales: 1890, Gross: 4800 },
        { name: 'Jun', Sales: 2390, Gross: 3800 },
        { name: 'Jul', Sales: 3490, Gross: 4300 },
        { name: 'Aug', Sales: 4000, Gross: 2400 },
        { name: 'Sep', Sales: 3000, Gross: 1398 },
        { name: 'Oct', Sales: 2000, Gross: 9800 },
        { name: 'Nov', Sales: 2780, Gross: 3908 },
        { name: 'Dec', Sales: 1890, Gross: 4800 },
    ];

    return (
        <div className={cx('dashboard')}>
            <div className={cx('header')}>
                <div className={cx('header_logo')}>
                    <FontAwesomeIcon className={cx('clock_icon')} icon={faClock} />
                    <h1 className={cx('logo_h1')}> Smart Water Meter</h1>
                </div>
                <div className={cx('header_menu')}>
                    <ul className={cx('menu_nav')}>
                        <li className={cx('menu_li')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faHouse} />
                            <a className={cx('li_a')}>Home</a>
                        </li>
                        <li onClick={DashBoard} className={cx('menu_li')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faChartSimple} />
                            <a className={cx('li_a')}>Dashboard</a>
                        </li>
                        <li className={cx('menu_li')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faPeopleGroup} />
                            <a className={cx('li_a')}>Team</a>
                        </li>
                        <li className={cx('menu_li_user')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faUserAlt} />
                            <a className={cx('li_a')}>User</a>
                            <ul className={cx('user_menu')}>
                                <li>
                                    <a onClick={User} className={cx('li_a_sub')}>
                                        User
                                    </a>
                                </li>
                                <li>
                                    <a onClick={Logout} className={cx('li_a_sub')}>
                                        Logout
                                    </a>
                                </li>
                            </ul>
                        </li>
                    </ul>
                </div>
            </div>
            <div className={cx('content')}>
                <ResponsiveContainer width="100%" height={300}>
                    <LineChart data={data} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
                        <XAxis dataKey="name" />
                        <YAxis />
                        <CartesianGrid strokeDasharray="3 3" />
                        <Tooltip />
                        <Legend />
                        <Line type="monotone" dataKey="Sales" stroke="#8884d8" activeDot={{ r: 8 }} />
                        <Line type="monotone" dataKey="Gross" stroke="#82ca9d" />
                    </LineChart>
                </ResponsiveContainer>
            </div>
        </div>
    );
}
export default MyChart;
